for(int i=0; i<number_flows; i++){
    boolean bclosed = false;
    try {
        if ("1".equals(result[i][9])) {
           bclosed = true;
        }
    }
    catch (Exception e) {
    }
    
    _res_closed[i] = (bclosed)?"Fechado":"Aberto";
}

_res_outrosDados = new String[number_flows];
for(int i=0; i<number_flows; i++){

    String[] dados_part = result[i][10].split(";");
    for(int j=0; j < dados_part.length; j++) {
        String dado = dados_part[j];
        dado = dado.trim();
        if (dado.startsWith("Nº de Processo")) {
            _res_outrosDados[i] = dado.substring(dado.indexOf("=")+2);
            break;
        }
    }
}

_critList_SearchFieldNames = null;
_critList_SearchFieldIdxs = null;

// obtem variaveis de pesquisa para processos semelhantes
String[][] auxFields = MyBshUtils.getSeachableFields(userInfo, String.valueOf(_flowid));

int size = auxFields.length;
_critList_SearchFieldNames = new String[size];
_critList_SearchFieldIdxs = new String[size];

for (int i=0; i<auxFields.length; i++) {
    _critList_SearchFieldNames[i] = auxFields[i][0];
    _critList_SearchFieldIdxs[i] = auxFields[i][1];
}

_whereClause = "('" + search_numero_processo + "'='' or id_processo='" 
+ search_numero_processo + "') and ('" + search_assunto_processo 
+ "'='' or assunto='" + search_assunto_processo + "')";



if (!"".equals(_search_nome_cm_processo)) {
    _whereClause += " and (";

    String search_cliente_cm_processado = "";

  String[] search_nome_parts = _search_nome_cm_processo.split(" ");

  for (int i=0; i < search_nome_parts.length; i++) {
		if (!"".equals(search_nome_cliente_processado)) {
			search_nome_cliente_processado += " and";
		}
		search_cliente_cm_processado += " lower(nome_cliente) like lower('%" + _search_nome_cm_processo + "%')";
  }

  _whereClause += search_cliente_cm_processado + ") or (";

  search_cliente_cm_processado = "";
  for (int i=0; i < search_nome_parts.length; i++) {
		if (!"".equals(search_nome_cliente_processado)) {
			search_nome_cliente_processado += " and";
		}
		search_cliente_cm_processado += " lower(nome_representante) like lower('%" + _search_nome_cm_processo + "%')";
  }

  _whereClause += search_cliente_cm_processado + ")";
}

java.text.SimpleDateFormat sdf = new java.text.SimpleDateFormat("yyyy-MM-dd");
if (_search_data_desde_processo != null) {
  _whereClause += " and data_requerimento >= date_sub('" 
  + sdf.format(_search_data_desde_processo) + "', INTERVAL 1 DAY)";
}

if (_search_data_ate_processo != null) {
  _whereClause += " and data_requerimento <= date_add('" 
  + sdf.format(_search_data_ate_processo) + "', INTERVAL 1 DAY)";
}
